(607, 'options_personal', '&nbsp;\r\n<div class=\"container\"><header>\r\n<div class=\"header-seconday-menu\">\r\n<div class=\"clearfix\">\r\n<div class=\"d-none d-md-block col-md-14 offset-md-4 offset-lg-0 col-lg-20 col-xxl-16\">\r\n<div class=\"header--contact\">\r\n<div class=\"header--contact-item\">\r\n<div class=\"header--contact-item-inner\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</header><section class=\"main-content\">\r\n<div class=\"container text-center breadcrumb_color\"><nav class=\"breadcrumb\"><span class=\"breadcrumb-item active\">СОГЛАШЕНИЕ ОБ ИСПОЛЬЗОВАНИИ САЙТА И ОБРАБОТКЕ ПЕРСОНАЛЬНЫХ ДАННЫХ</span></nav></div>\r\n<div class=\"container bg-white trim_wrap\"><section class=\"simple-page small_img\">\r\n<div class=\"col-lg-24\">\r\n\r\n<div class=\"simple-page--inner\">\r\n<div class=\"trevor-mce \">\r\n<h4>1. Общие положения</h4>\r\n1.1 Группа дилерских центров Планета Авто Восток (далее по тексту – Оператор) ставит соблюдение прав и свобод граждан одним из важнейших условий осуществления своей деятельности.\r\n1.2 Политика Оператора в отношении обработки персональных данных (далее по тексту — Политика) применяется ко всей информации, которую Оператор может получить о посетителях веб-сайта planeta-avto-vostok.ru. Персональные данные обрабатывается в соответствии с ФЗ «О персональных данных» № 152-ФЗ.\r\n<h4>2. Основные понятия, используемые в Политике:</h4>\r\n2.1 Веб-сайт - совокупность графических и информационных материалов, а также программ для ЭВМ и баз данных, обеспечивающих их доступность в сети интернет по сетевому адресу planeta-avto-vostok.ru;\r\n2.2 Пользователь – любой посетитель веб-сайта planeta-avto-vostok.ru;\r\n2.3 Персональные данные – любая информация, относящаяся к Пользователю веб-сайта planeta-avto-vostok.ru;\r\n2.4 Обработка персональных данных - любое действие с персональными данными, совершаемые с использованием ЭВМ, равно как и без их использования;\r\n2.5 Обезличивание персональных данных – действия, результатом которых является невозможность без использования дополнительной информации определить принадлежность персональных данных конкретному Пользователю или лицу;\r\n2.6 Распространение персональных данных – любые действия, результатом которых является раскрытие персональных данных неопределенному кругу лиц;\r\n2.7 Предоставление персональных данных – любые действия, результатом которых является раскрытие персональных данных определенному кругу лиц;\r\n2.8 Уничтожение персональных данных – любые действия, результатом которых является безвозвратное уничтожение персональных на ЭВМ или любых других носителях.\r\n<h4>3. Оператор может обрабатывать следующие персональные данные Пользователя:</h4>\r\n3.1 Список персональных данных, которые обрабатывает оператор: фамилия, имя, отчество, номер телефона, адрес электронной почты.\r\n3.2. Кроме того, на сайте происходит сбор и обработка обезличенных данных о посетителях (в т.ч. файлов «cookie») с помощью сервисов интернет-статистики (Яндекс Метрика, Гугл Аналитика и других).\r\n<h4>4. Цели обработки персональных данных</h4>\r\n4.1 Персональные данные пользователя - фамилия, имя, отчество, номер телефона, адрес электронной почты - обрабатываются со следующей целью: Уточнение деталей и отправка заказа клиенту, Почтовая рассылка новостей компании. Оператор имеет право направлять Пользователю уведомления о новых продуктах и услугах, специальных предложениях и различных событиях. Пользователь всегда может отказаться от получения информационных сообщений, направив Оператору письмо на адрес akrukov@fordcv.ru\r\n4.2 Обезличенные данные Пользователей, собираемые с помощью сервисов интернет-статистики, служат для сбора информации о действиях Пользователей на сайте, улучшения качества сайта и его содержания.\r\n<h4>5. Правовые основания обработки персональных данных</h4>\r\n5.1 Оператор обрабатывает персональные данные Пользователя только в случае их отправки Пользователем через формы, расположенные на веб-сайте planeta-avto-vostok.ru. Отправляя свои персональные данные Оператору, Пользователь выражает свое согласие с данной Политикой.\r\n5.2 Оператор обрабатывает обезличенные данные о Пользователе в случае, если Пользователь разрешил это в настройках браузера (включено сохранение файлов «cookie» и использование технологии JavaScript).\r\n<h4>6. Порядок сбора, хранения, передачи и других видов обработки персональных данных</h4>\r\n6.1 Оператор обеспечивает сохранность персональных данных и принимает все возможные меры, исключающие доступ к персональным данным неуполномоченных лиц.\r\n6.2 Персональные данные Пользователя никогда, ни при каких условиях не будут переданы третьим лицам, за исключением случаев, связанных с исполнением действующего законодательства.\r\n6.3. В случае выявления неточностей в персональных данных, Пользователь может актуализировать их, направив Оператору уведомление с помощью электронной почты на электронный адрес Оператора akrukov@fordcv.ru, либо на почтовый адрес Оператора 454000, Челябинск, Копейское Шоссе 82, с пометкой «Актуализация персональных данных».\r\n6.3 Срок обработки персональных данных является неограниченным. Пользователь может в любой момент отозвать свое согласие на обработку персональных данных, направив Оператору уведомление с помощью электронной почты на электронный адрес Оператора akrukov@fordcv.ru, либо на почтовый адрес Оператора 454000, Челябинск, Копейское Шоссе 82, с пометкой «Отзыв согласия на обработку персональных данных».\r\n<h4>7. Заключительные положения</h4>\r\n7.1. Пользователь может получить любые разъяснения по интересующим вопросам, касающимся обработки его персональных данных, обратившись к Оператору с помощью электронной почты akrukov@fordcv.ru, либо на почтовый адрес Оператора 54000, Челябинск, Копейское Шоссе 82.\r\n7.2. В данном документе будут отражены любые изменения политики обработки персональных данных Оператором. В случае существенных изменений Пользователю может быть выслана информация на указанный им электронный адрес.\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</section></div>\r\n</section></div>\r\n&nbsp;', 'no'),
