(62, 1, 'wp_yoast_notifications', 'a:4:{i:0;a:2:{s:7:\"message\";s:1041:\"Мы заметили, вы используете Yoast SEO  в течение некоторого времени; мы надеемся, что вы любите его! Мы были бы в восторге, если вы могли бы <a href=\"https://yoa.st/rate-yoast-seo?php_version=7.3.12&platform=wordpress&platform_version=5.3.2&software=premium&software_version=10.0.1&role=administrator&days_active=26\"> дать нам 5 звезд рейтинга на WordPress.org</a>!\n\nЕсли у вас возникли проблемы, <a href=\"https://yoa.st/bugreport?php_version=7.3.12&platform=wordpress&platform_version=5.3.2&software=premium&software_version=10.0.1&role=administrator&days_active=26\"> предоставьте отчет об ошибке </a> и мы сделаем все возможное, чтобы помочь вам.\n\n\n\n<a class=\"button\" href=\"http://body-repair.vold74.ru/wp-admin/?page=wpseo_dashboard&yoast_dismiss=upsell\"> Не показывать это уведомление больше </a>\";s:7:\"options\";a:9:{s:4:\"type\";s:7:\"warning\";s:2:\"id\";s:19:\"wpseo-upsell-notice\";s:5:\"nonce\";N;s:8:\"priority\";d:0.8000000000000000444089209850062616169452667236328125;s:9:\"data_json\";a:0:{}s:13:\"dismissal_key\";N;s:12:\"capabilities\";s:20:\"wpseo_manage_options\";s:16:\"capability_check\";s:3:\"all\";s:14:\"yoast_branding\";b:0;}}i:1;a:2:{s:7:\"message\";s:240:\"Не пропустите свои ошибки индексирования: <a href=\"http://body-repair.vold74.ru/wp-admin/admin.php?page=wpseo_search_console&tab=settings\">подключитесь к Google Search Console здесь</a>.\";s:7:\"options\";a:9:{s:4:\"type\";s:7:\"warning\";s:2:\"id\";s:17:\"wpseo-dismiss-gsc\";s:5:\"nonce\";N;s:8:\"priority\";d:0.5;s:9:\"data_json\";a:0:{}s:13:\"dismissal_key\";N;s:12:\"capabilities\";s:20:\"wpseo_manage_options\";s:16:\"capability_check\";s:3:\"all\";s:14:\"yoast_branding\";b:0;}}i:2;a:2:{s:7:\"message\";s:395:\"У вас в WordPress, до сих пор установлено название сайта по умолчанию. Наверно лучше сделать его пустым, чем как сейчас. <a href=\"http://body-repair.vold74.ru/wp-admin/customize.php?autofocus[control]=blogdescription\"> вы всегда можете исправить его в настройщике </a>.\";s:7:\"options\";a:9:{s:4:\"type\";s:5:\"error\";s:2:\"id\";s:28:\"wpseo-dismiss-tagline-notice\";s:5:\"nonce\";N;s:8:\"priority\";d:0.5;s:9:\"data_json\";a:0:{}s:13:\"dismissal_key\";N;s:12:\"capabilities\";s:20:\"wpseo_manage_options\";s:16:\"capability_check\";s:3:\"all\";s:14:\"yoast_branding\";b:0;}}i:3;a:2:{s:7:\"message\";s:402:\"<strong>Серьёзная проблема для SEO: Вы блокируете доступ для поисковых роботов.</strong> Вы должны <a href=\"http://body-repair.vold74.ru/wp-admin/options-reading.php\">зайти в Настройки чтения</a> и убрать галочку рядом с пунктом \"Видимость для поисковых систем\".\";s:7:\"options\";a:9:{s:4:\"type\";s:5:\"error\";s:2:\"id\";s:32:\"wpseo-dismiss-blog-public-notice\";s:5:\"nonce\";N;s:8:\"priority\";i:1;s:9:\"data_json\";a:0:{}s:13:\"dismissal_key\";N;s:12:\"capabilities\";s:20:\"wpseo_manage_options\";s:16:\"capability_check\";s:3:\"all\";s:14:\"yoast_branding\";b:0;}}}'),
